import { Component } from 'react'
import Filter from '@/subcomponents/filter'
import withRedux from "next-redux-wrapper";
import makeStore from "../redux/reducers/filterReducer"

class Search extends Component {
    constructor(props){
        super(props)
        console.log(props)
    }
    
    static getInitialProps = async ({store, isServer, pathname, query}) => {
        // component will read from store's state when rendered
        store.dispatch({type: 'FOO', payload: 'foo'});
        const res = await fetch('http://192.168.1.107:5566/api/bina/filter')
        const filter = await res.json()
        return {
          props: {
            filter,
          },
        }
      };

    render(h) {
        console.log(this.props.filterJsons)
        return (
            <div className={'container'}>
                <div className={'leftSide'}>
                    <Filter  filterJson={this.props.filter}></Filter>
                </div>
                <div className={'rightSide'}></div>
            </div>
        );
    }
}

Search = withRedux(makeStore, (state) => ({foo: state.foo}))(Search);

